import React from 'react';
import './ex-5.css'
function Exercise5(){
   return( 

   < div class="mainbody">
       <div>
        <h4 style={{display: 'inline-block'}}><b>Current Status: </b><span style={{textDecoration:'none',fontWeight: 'normal'}}> Started....</span></h4>
        </div>

        <div class="grid-container">
        <div class="grid-item"><input type='button'>STOP</input></div>
        <div class="grid-item"><btn>RESET</btn></div>
        <div class="grid-item"><btn>SPEED</btn></div>
        </div>

    </div>

   )
}

export default Exercise5;
